                <div class=""col-md-6"">
                    <h3 class=""about-title"">Floresça...onde Deus te Plantar</h3>
                    <p>
                        A  figura feminina ao longo dos tempos , sempre foi admirada em nossa sociedade, infelizmente muito mais por uma visão de posse, de propriedade, do que por suas
                        necessidades, ambições e sonhos.
                        Suas dores e dificuldades quase sempre menosprezadas ou nem vistas, há pouco tempo que ajustes no sentido de balizar as diferenças de gênero tem sido feitos,
                        mas ainda há muito o que se fazer para que exista uma real equidade de gênero e  é nesse sentido que foi criado o floreça.
                    <p>
                        Mais do que uma ferramenta que auxilia mulheres, a Floresça é uma ferramenta de transformação social que liga mulheres e suas necessidades, ter voluntários dipostos
                        a ajudar, protagonizando não só a tra");
            WriteLiteral(@"nsformação dessas mulheres em situação de vulnerabilidade, como a  dos profissionais e voluntários que terão suas vidas
